import React from 'react';
import { connect } from "react-redux";
import { toggleMemberSignin } from "../../redux/site-members/site-member.actions";

import './navigation.styles.scss'

const Navigation = ({ onRouteChange, isSignedIn, signOut }) => {
    if (isSignedIn) {
      return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
          <p onClick={signOut} className='link'>Sign Out</p>
        </nav>
      );
    } else {
      return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
          <p onClick={() => onRouteChange('signin')} className='link'>Sign In</p>
          <p onClick={() => onRouteChange('register')} className='link'>Register</p>
        </nav>
      );
    }
}

const mapStateToProps = (state) => ({
    isSignedIn: state.memberSignInState.memberSignedIn
});

const mapDispatchToProps = (dispatch) => ({
    signOut: () => {dispatch(toggleMemberSignin())}
  });

export default connect(mapStateToProps, mapDispatchToProps)(Navigation);
